import React from 'react'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import { OmitProps } from 'antd/lib/transfer/ListBody'


const Layout = ({ children }) => {
    return(
        <div>
            <Navbar />
                <div>
                    {children}
                </div>
            <Footer />
        </div>


    )
}

export default Layout;
